import React, { useState, useEffect } from 'react';
import { fetchFormById } from '../services/api';

const FeedbackDetailsPage = ({ id }) => {
  const [feedback, setFeedback] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchFeedback = async () => {
      try {
        const data = await fetchFormById(id);
        setFeedback(data);
        setLoading(false);
      } catch (err) {
        setError('Error fetching feedback details');
        setLoading(false);
      }
    };

    fetchFeedback();
  }, [id]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;
  if (!feedback) return <div>No feedback found</div>;

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Feedback Details</h1>
      <div className="grid grid-cols-2 gap-4">
        <div>
          <h2 className="text-xl font-semibold mb-2">Institution Information</h2>
          <table className="w-full">
            <tbody>
              <tr><td className="font-semibold">Institution Name:</td><td>{feedback.institutionName}</td></tr>
              <tr><td className="font-semibold">Website:</td><td>{feedback.website}</td></tr>
              <tr><td className="font-semibold">Visit Date:</td><td>{new Date(feedback.visitDate).toLocaleDateString()}</td></tr>
              <tr><td className="font-semibold">Staff Name:</td><td>{feedback.staffName}</td></tr>
              <tr><td className="font-semibold">Staff Email:</td><td>{feedback.staffEmail}</td></tr>
              <tr><td className="font-semibold">Staff Mobile:</td><td>{feedback.staffMobile}</td></tr>
              <tr><td className="font-semibold">Total Students:</td><td>{feedback.totalStudents}</td></tr>
              <tr><td className="font-semibold">Accompanying Staff:</td><td>{feedback.accompanyingStaff}</td></tr>
            </tbody>
          </table>
        </div>
        
        <div>
          <h2 className="text-xl font-semibold mb-2">Ratings</h2>
          <table className="w-full">
            <tbody>
              <tr><td className="font-semibold">IPR Rating:</td><td>{feedback.ratings?.iprRating}</td></tr>
              <tr><td className="font-semibold">FCIPT Rating:</td><td>{feedback.ratings?.fciptRating}</td></tr>
              <tr><td className="font-semibold">Knowledge:</td><td>{feedback.ratings?.knowledge}</td></tr>
              <tr><td className="font-semibold">Explanations IPR:</td><td>{feedback.ratings?.explanationsIPR}</td></tr>
              <tr><td className="font-semibold">Explanations FCIPT:</td><td>{feedback.ratings?.explanationsFCIPT}</td></tr>
              <tr><td className="font-semibold">Knowledge Before:</td><td>{feedback.ratings?.knowledgeBefore}</td></tr>
              <tr><td className="font-semibold">Knowledge After:</td><td>{feedback.ratings?.knowledgeAfter}</td></tr>
              <tr><td className="font-semibold">Technical Contents:</td><td>{feedback.ratings?.technicalContents}</td></tr>
              <tr><td className="font-semibold">Ease of Understanding:</td><td>{feedback.ratings?.easeOfUnderstanding}</td></tr>
            </tbody>
          </table>
        </div>
      </div>

      <div className="mt-4">
        <h2 className="text-xl font-semibold mb-2">Additional Information</h2>
        <p><span className="font-semibold">Sources:</span> {feedback.sources?.join(', ')}</p>
        <p><span className="font-semibold">Campuses:</span> {feedback.campuses?.join(', ')}</p>
        <p><span className="font-semibold">Best:</span> {feedback.best}</p>
        <p><span className="font-semibold">Worst:</span> {feedback.worst}</p>
        <p><span className="font-semibold">Suggestions:</span> {feedback.suggestions}</p>
        <p><span className="font-semibold">Comments:</span> {feedback.comments}</p>
      </div>

      <div className="mt-4">
        <p><span className="font-semibold">Created At:</span> {new Date(feedback.createdAt).toLocaleString()}</p>
        <p><span className="font-semibold">Updated At:</span> {new Date(feedback.updatedAt).toLocaleString()}</p>
      </div>
    </div>
  );
};

export default FeedbackDetailsPage;
